import './Databases.css'

const Databases = () => {


const DbEntry = ({ data }) => {
	return (
		<div className='Entry'>
			<p className='Title'>{data.title}</p>
			{data._id}
		</div>
	)
}


	return (
		<div className='DatabaseList'>
			<div className='BlastDb'></div>
			<div className='SkaniSketch'></div>
		</div>
	)
}

export default Databases
